  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:43.101161\",\n\t\"name\": \"quivira-national-wildlife-refuge-annual-narrative-report-calendar-year-1984\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Quivira
  National Wildlife Refuge outlines Refuge accomplishments during the 1984 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Refuge administration is outlined; information about personnel, youth programs,
  manpower programs, funding, and safety is given. Habitat management is also covered;
  subjects include wetlands, croplands, grasslands, grazing, haying, fire management,
  pest control, water rights, and wilderness areas. The wildlife section of the report
  discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
  birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources, and
  marking and bird banding. The public uses of the Refuge described in this report
  include outdoor classrooms, interpretive programs, hunting, fishing, wildlife observation,
  outdoor recreation, and law enforcement. The equipment and facilities section of
  the report provides information about new construction, rehabilitation, and equipment
  replacement. Cooperative programs and items of interest are provided at the end.\",\n\t\"license_title\":
